import React from 'react';

import './SideDrawer.css'

const sideDrawer = () => {

    let sideDrawerClasses = 'side-drawer';

    if (props.sideDrawerOpen) {
        sideDrawerClasses = 'side-drawer__open'
    }

    return (
        <nav className='side-drawer'>
            <ul className='side-drawer__list'>
                <li className='side-drawer__item' >About</li>
                <li className='side-drawer__item' >Projects</li>
            </ul>
        </nav>
    );
}

export default sideDrawer;
